import numpy as np
import pandas as pd


# Declaração das variáveis
dt = np.arange(0, 10.5, 0.5)
vterm = 25
x0 = 200 + 125
t0 = 5

# Derivdada primeira de dx/dt
dv = -vterm * (1 - np.exp(-dt/t0))
# Derivada segunda de dx/dt
da = -t0 * np.exp(-dt/t0)
# Equação da posição
dx = -vterm * (dt + (t0 * np.exp(-dt/t0))) + x0

# Criação do Dataframe
df = pd.DataFrame(columns=['Tempo (s)', 'Posição (m)', 'Velocidade (m/s)', 
                           'Aceleração (m/s²)'])

# Alimentação do Dataframe com os dados
for c in range(0, len(dt)):
    df.loc[c] = [dt[c], dx[c], dv[c], da[c]]

# Mostra na tela o resultado
print(df)

